INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (0, 3001, 1, 5, 1, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 1, 2, "vo_minigame_1012_result_1080", 12300148, 0.0, 1, 9);
